import React, { useState, useEffect } from 'react';
import '../../estilos/componentes/layout/nav.css'
import { Link } from 'react-router-dom';
import { obtenerDatosPersonales } from "../../api.js";

const Nav = (props) => {

    const [datosPersonales, setDatosPersonales] = useState([]);

    useEffect(() => {
        const fetchDatosPersonales = async () => {
            const datos = await obtenerDatosPersonales();
            setDatosPersonales(datos);
        };

        fetchDatosPersonales();
    }, []);

    return (
        <div>
            <aside className="aside">
                <div className="accordion" id="accordionExample"/>
                    <div className="accordion-item">
                        <h4 className="accordion-header">
                            <button className="accordion-button collapsed" type="button" data-bs-toggle="collapse"
                                data-bs-target="#collapseOne" aria-expanded="false" aria-controls="collapseOne">
                                Datos personales
                            </button>
                        </h4>
                        <div id="collapseOne" className="accordion-collapse collapse">
                            <div className="accordion-body">
                                <div className="Personales">
                                {datosPersonales.map((item, index) => (
                                        <div key={index}>
                                            <p>Edad: {item.edad}</p>
                                            <p>Nacionalidad: {item.nacionalidad}</p>
                                            <p>DNI: {item.dni}</p>
                                            <p>Domicilio: {item.domicilio}</p>
                                        </div>
                                    ))}
                                </div>
                            </div>
                        </div>
                    </div>
                    <div className="accordion-item">
                        <h4 className="accordion-header">
                            <button className="accordion-button collapsed" type="button" data-bs-toggle="collapse"
                                data-bs-target="#collapseTwo" aria-expanded="false" aria-controls="collapseTwo">
                                Contacto
                            </button>
                        </h4>
                        <div id="collapseTwo" className="accordion-collapse collapse">
                            <div className="accordion-body">
                                <div className="contacto">
                                    <div className="contSocial">
                                        <a className="enlaceContacto"><i className="fa-solid fa-envelope"></i></a>
                                        <a href="https://github.com/Ivan-cinho" target="_blank"><i className="fa-brands fa-github"></i></a>
                                        <a href="https://www.linkedin.com/in/pablo-iv%C3%A1n-b%C3%A1rcena-b21b7956/" target="_blank"><i className="fa-brands fa-linkedin"></i></a>
                                    </div>
                                </div>
                            </div>
                        </div>
                </div>
                    <div className="contBotonera">
                        <Link to="/inicio" className="btn btn-primary botonInicio botonSecciones">Inicio</Link>
                        <Link to="/formacion" className="btn btn-primary botonFormacion botonSecciones">Formación</Link>
                        <Link to="/experiencia" className="btn btn-primary botonExperiencia botonSecciones">Experiencia laboral</Link>
                    </div>
            </aside>
        </div>
    );
}

export default Nav;
